import React from 'react';
import styled from 'styled-components';

const StyledAverage = styled.div`
  width: 25px;
  height: 25px;
  background-color: #c0c7d6;
  border-radius: 50%;
  border: none;
  color: white;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Average = () => <StyledAverage></StyledAverage>;

export default Average;
